import React from "react";

const Booking = (props) => {
  return (
          <Link to={`/editbooking/${props.booking.id}`}>
            <div>
              Customer: {props.booking.customer.name} <br />
              Table: {props.booking.restaurantTable.number} <br />
              Time: {props.booking.time} PM
            </div>
          </Link>
    )
}

export default Booking;
